window.bookSummaryJSON = "<p>Once upon a time, there was a princess with no notion of right and wrong, and a queen a thousand times more twisted.</p> <p>In the realm of Tenebris, home to the unseelie folk, curses are served for breakfast with a side of betrayal.</p> <p>Vlari was born a threat to Queen Morgana. She survived her wrath because she never stepped out of line.</p> <p>Until one night. One man. One war.</p> <p>Now that she's unchained, Vlari's consumed by a desire to drain the lives of all those around her. And yet her decisions shape the fate of the entire realm of the fae.</p> <p>Sometimes the world needs a hero. In a land of shadows, it might just need a monster.</p> <p><i>Ruled by Blood </i>is a tale of magic, secrets, and schemes, perfect for fantasy listeners who enjoy a dash of romance.</p> <p>This version combines both parts: <i>Wicked Court </i>and <i>Shadow Cursed</i>.</p>"; 
